(160, 27, 1, '', '2015-05-02 20:42:50', 989, 2743, '899b77a469bb9e02f4f38dc6f67c02e8eb75d881', '{"id":27,"asset_id":"113","title":"Golf Course House","alias":"golf-course-house","introtext":"<p>The green grassy fairways and lush landscaping of the 13th Beach Golf Course surround this residence. At the front entry, a central axis opens out to a stand of cypresses fringing the 1st tee. There are the occasional long views of golfers. The house embraces its natural surroundings and the beauty of the environment. Small private courtyards are also located within the house that enables the outdoors to be enjoyed in all seasons.<\\/p>\\r\\n<p>The materials palette reflects the casual holiday style - spotted gum cladding predominating with individual modules attached in folded zincalume and painted cement sheet. These materials flow through to the interiors and are lustrously lit at night.<\\/p>\\r\\n<p>The extensive central axis in polished concrete contrasts with the soft, lush, amber of the matt cork tiles throughout the kitchen, living and dining area. A glass roofed cylinder captures the morning light and folds around a circular table to provide an intimate breakfast space adjoined to the otherwise large volumes throughout.<\\/p>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 20:42:50","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 20:42:33","publish_up":"2015-05-02 20:42:33","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"sh