(162, 26, 1, '', '2015-05-02 20:48:43', 989, 2859, '1c68f7d341181b7034ace5b3942daeb858dc8186', '{"id":26,"asset_id":"111","title":"Tree House Description","alias":"tree-house-description","introtext":"<p><span style=\\"font-size: 15pt;\\">Perched in the Otway Ranges, the Lorne Tree House hides seductively amongst the eucalypts. <\\/span><\\/p>\\r\\n<p><span style=\\"font-size: 15pt; mso-bidi-font-size: 11.0pt;\\">The exterior of the house is clad in stained timber, copper, corten steel and painted cement sheet. These materials weather naturally to a recessive palette blending with the surrounding environment. <\\/span><\\/p>\\r\\n<p><span style=\\"font-size: 15pt; mso-bidi-font-size: 11.0pt;\\">The use of perforated metal screens at ground level enables through air flow to be maintained around the house. <\\/span><\\/p>\\r\\n<p><span style=\\"font-size: 15pt; mso-bidi-font-size: 11.0pt;\\">In the summer months movement of cool air up through the levels of the house minimizes the need for air conditioning. <\\/span><\\/p>\\r\\n<p><span style=\\"font-size: 15pt; mso-bidi-font-size: 11.0pt;\\">Interiors of the house are deliberately kept simple and in natural tonings. Timber floors blend seamlessly into the decks. Timber walkways at the entry bridge the steepness of the site thus enabling the natural gradients to remain unimpeded<\\/span>.<\\/p>\\r\\n<p>\\u00a0<\\/p>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 19:53:39","created_by":"989","created_by_alias":"","modified":"2015-05-02 20:48:43","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 20:48:26","publish_up":"2015-05-02 19:53:39","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\