(169, 29, 1, '', '2015-05-02 21:06:10', 989, 2500, 'a887e94ae1be6c9c4658100b8c35f25c37c86d4c', '{"id":29,"asset_id":"115","title":"Sorrento Beach House","alias":"sorrento-beach-house","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>The juxtaposition of strong geometric forms - constructed in local stone, glass, rheinzink and spotted gum - characterizes the design of this house. Ground floor entertainment areas open out on all sides engaging with the extensive recreational opportunities on the site \\u2013 playing tennis, swimming, sunbathing, cooking pizzas, picking olives or gathering around the fire pit or BBQ.<\\/p>\\r\\n<p>The building entry with the reflective pool, hovering rheinzinc cube and illuminated undercroft has been carefully crafted to create a hint of the fun and relaxation that being on holiday can provide. Interiors are casually grounded with the use of local stone for many walls, seamless indoor outdoor openings and rugged polished timber floors.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:06:10","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 21:05:17","publish_up":"2015-05-02 20:42:33","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\"