(180, 32, 1, '', '2015-05-02 21:22:33', 989, 2548, 'cb835d4f6ca6a054cb529422b1a6815b437893f8', '{"id":32,"asset_id":118,"title":"Richmond House (2)","alias":"richmond-house-2","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Responding boldly to the challenges of a tight inner city site, Richmond House provides a sanctuary amidst the traffic and intensity of the immediate surroundings. The interior is private, quiet and visually exciting. The exterior is assertive in its presence - but not dominating - and contributes to the vitality and interest of the street.<\\/p>\\r\\n<p>The front fa\\u00e7ade is notched to provide a protected entry and enable views of the Victorian cottage adjacent. Large screens prevent invasive views and rooms revolve around protective courtyards and decks. A vertical garden is the main feature of the central internal courtyard.<\\/p>\\r\\n<p>An adjacent peppercorn tree forms a protective veil. A stacked stone wall along the entry path conceals rain water tanks for the gardens and also holds grasses and orchids along the entry.<\\/p>\\r\\n<\\/div>","fulltext":"","state":0,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:22:33","modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":"2015-05-02 20:42:33","publish_down":"","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":1,"ordering":null,"metakey":"","metadesc":"","access":"1","hits":null,"metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
(181, 32, 1, '', '2015-05-02 21:23:29', 989, 3012, 'b83bc5e65770ba1cdbccefb287066f2bb07d873c', '{"id":32,"asset_id":"118","title":"Jonty House","alias":"jonty-house","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Located in the Melbourne inner city, this rear addition to a simple cottage breaks out exuberantly from the confines of the historic structure.<\\/p>\\r\\n<p>Unseen from the heritage street frontage, the upper floor floats seamlessly and opens out to a concertina deck with panoramic city views. Privacy of neighbours is ensured by the use of screens formed from aluminium box sections. Enfolding the upper floor and, together with panels of white glass, these sections form an ephemeral band around the structure.<\\/p>\\r\\n<p>The aesthetic potential of metal layering is celebrated by creating varying widths, perforation and sizing. The resultant softness of interior illumination and blending of the structure with the sky provides a heightened sense of lightness and exhilaration. A staircase clad in Spectra Alucobond gleams and is a theatrical negative joint marking the transition from old to new.<\\/p>\\r\\n<p>A palette of contrasts is carefully crafted with stainless steel, timber and pale natural stone intersecting with dark grey Alpaca carpet, black terrazzo, concrete, bluestone and deep red corten steel. The pre-existing dark interior of the cottage has been retained for bedrooms \\u2013 the journey through the building is towards the light of the new additions.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:23:29","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 21:22:33","publish_up":"2015-05-02 20:42:33","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\