(197, 34, 1, '', '2015-05-02 21:42:17', 989, 3048, 'e6a8051b610f81a7ed90abe963a5ebc21c811569', '{"id":"34","asset_id":"120","title":"Richmond Warehouse","alias":"richmond-warehouse","introtext":"<p><span style=\\"line-height: 115%; font-family: ''Calibri'',sans-serif; font-size: 10pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\\"><span style=\\"color: #000000;\\">Nestled inside a multi-story turn of the century warehousing complex, this refurbished building has soaring interior spaces and robust red brick walls retained from the original structure.<\\/span><span style=\\"mso-spacerun: yes;\\"><span style=\\"color: #000000;\\">\\u00a0 <\\/span><\\/span><\\/span><\\/p>\\r\\n","fulltext":"\\r\\n<p><span style=\\"line-height: 115%; font-family: ''Calibri'',sans-serif; font-size: 10pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\\"><span style=\\"mso-spacerun: yes;\\"><span style=\\"color: #000000;\\">{loadposition residential_richmond_warehouse}<\\/span><\\/span><\\/span><\\/p>","state":"1","catid":"8","created":"2015-05-02 21:36:47","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:42:17","modified_by":"989","checked_out":"0","checked_out_time":"0000-00-00 00:00:00","publish_up":"2015-05-02 21:36:47","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"images\\\\\\/Projects\\\\\\/residential\\\\\\/richmond_warehouse\\\\\\/richmond_Warehouse_article_listing.jpg\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_captio